// SPDX-License-Identifier: UNLICENSE
pragma solidity ^0.7.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "../../interfaces/IGyroConfig.sol";
import "../../libraries/GyroConfigKeys.sol";

contract MockGyroConfig is IGyroConfig, Ownable {
    mapping(bytes32 => uint256) internal uintConfig;
    mapping(bytes32 => address) internal addressConfig;

    constructor() Ownable() {
        uintConfig[GyroConfigKeys.PROTOCOL_FEE_GYRO_PORTION_KEY] = 1e18;
    }

    /// @inheritdoc IGyroConfig
    function listKeys() external pure override returns (bytes32[] memory) {
        bytes32[] memory keys = new bytes32[](4);
        keys[0] = GyroConfigKeys.PROTOCOL_SWAP_FEE_PERC_KEY;
        keys[1] = GyroConfigKeys.PROTOCOL_FEE_GYRO_PORTION_KEY;
        keys[2] = GyroConfigKeys.GYRO_TREASURY_KEY;
        keys[3] = GyroConfigKeys.BAL_TREASURY_KEY;
        return keys;
    }

    /// @inheritdoc IGyroConfig
    function getUint(bytes32 key) external view override returns (uint256) {
        return uintConfig[key];
    }

    /// @inheritdoc IGyroConfig
    function getAddress(bytes32 key) external view override returns (address) {
        return addressConfig[key];
    }

    /// @inheritdoc IGyroConfig
    function setUint(bytes32 key, uint256 newValue) external override onlyOwner {
        uintConfig[key] = newValue;
    }

    /// @inheritdoc IGyroConfig
    function setAddress(bytes32 key, address newValue) external override onlyOwner {
        addressConfig[key] = newValue;
    }
}
